import React from 'react';
import './App.css';
import Card from './card';
import { useState,useEffect } from 'react';
import axios from 'axios';

function App() {

  const [items, setItems] = useState([]); 

    useEffect(() => { 
        axios.get("http://localhost:4000/cards").then((response) => { 
            setItems(response.data); 
        }) 
    }, [])
  // const items = [
  //   { title: "Branches", desc: "Abstract branches lets you manage,version,and documentation your design in one place" },
  //   { title: "Manage your account", desc: "Configure your account settings,such as your email ,profile details, and password" },
  //   { title: "Manage organizations, teams, and projects", desc: "Use abstract organization,teams,and projects to organize your people and your work" },
  //   { title: "Manage billing", desc: "Change subscriptions and payment details" },
  //   { title: "Authenticate to Abstract", desc: "Set up and configure SSO, SCIM, and Just-in-Time provisioning" },
  //   { title: "Abstract support", desc: "Get in touch with a human" }
  // ];

  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <div className="logo">Abstract | Help Center</div>
          <ul>
            <li><button className="request-button">Submit a request</button></li>
          </ul>
        </nav>
      </header>

      <section className="hero">
        <h1>How can we help?</h1>
        <div className="search-box">
          <input type="text" placeholder="search" />
          <button className="arrow">→</button>
        </div>
      </section>

      <main>
        <div className="content">
          {items.map((data, index) => (
            <Card key={index} title={data.title} desc={data.description} />
          ))}
        </div>
      </main>

      <footer className="footer">
        <div className="footer-section">
          <h3>Abstract</h3>
          <ul>
            <li>Branches</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Resources</h3>
          <ul>
            <li>Blog</li>
            <li>Help Center</li>
            <li>Release Notes</li>
            <li>Status</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Community</h3>
          <ul>
            <li>Twitter</li>
            <li>LinkedIn</li>
            <li>Facebook</li>
            <li>Dribbble</li>
            <li>Podcast</li>
          </ul>
        </div>
        <div className="footer-section">
          <h3>Company</h3>
          <ul>
            <li>About Us</li>
            <li>Careers</li>
            <li>Legal</li>
            <li>Contact Us: info@abstract.com</li>
          </ul>
        </div>
        <div className="footer-section copyright">
          ©Copyright 2022
          Abstract Studio Design, Inc.
          All rights reserved.
        </div>
      </footer>
    </div>
  );
}

export default App;
